import React, { useState, useEffect } from "react";
import { useSelector } from "react-redux";
function Employee(props) {
  const employees = useSelector((state) => state.employees);
  {
    employees.map((a) => (
      <tr key={a.id}>
        <td>{a.Name}</td>
      </tr>
    ));
  }
}

export default Employee;
